    /* check useEffec nêwus ko có token thì đẩy qua */
  }
  return (
    <BrowserRouter>
      <Routes>
        {CheckToken()} ? <Route path="/HomePage" element={<HomePage />} />
        : <Route path="/login" element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
